void inputElementsIntoTheArray(double** numbers, size_t rowsCount, size_t columnsCount)
{
    for (size_t i = 0; i < rowsCount; i++)
    {
        for (size_t j = 0; j < columnsCount; j++)
        {
            std::cin >> numbers[i][j];
        }

        if (i < (rowsCount - 1))
        {
            std::cout << "\n";
        }
    }
}

void transposeTheSquaredArray(double** numbers, size_t rowsCount)
{
    for (size_t i = 0; i < rowsCount; i++) 
    {
        for (size_t j = i + 1; j < rowsCount; j++) 
        {
            numbers[i][j] += numbers[j][i];

            numbers[j][i] = numbers[i][j] - numbers[j][i];

            numbers[i][j] -= numbers[j][i];
        }
    }
}

void transposeTheNonSquaredArray(double**& numbers, size_t& rowsCount, size_t& columnsCount)
{
    double** numbersCopy = new double * [columnsCount];

    for (size_t i = 0; i < columnsCount; i++)
    {
        numbersCopy[i] = new double[rowsCount];
    }

    for (size_t i = 0; i < columnsCount; i++)
    {
        for (size_t j = 0; j < rowsCount; j++)
        {
            numbersCopy[i][j] = numbers[j][i];
        }
    }

    disposeTheArray(numbers, rowsCount);

    swapTheRowsAndTheColumns(rowsCount, columnsCount);

    numbers = new double * [rowsCount];

    for (size_t i = 0; i < rowsCount; i++)
    {
        numbers[i] = new double[columnsCount];
    }

    for (size_t i = 0; i < rowsCount; i++)
    {
        for (size_t j = 0; j < columnsCount; j++)
        {
            numbers[i][j] = numbersCopy[i][j];
        }
    }

    disposeTheArray(numbersCopy, rowsCount);
}

void swapTheRowsAndTheColumns(size_t& rowsCount, size_t& columnsCount)
{
    rowsCount += columnsCount;

    columnsCount = rowsCount - columnsCount;

    rowsCount -= columnsCount;
}

void printTheArray(double** numbers, size_t rowsCount, size_t columnsCount)
{
    for (size_t i = 0; i < rowsCount; i++)
    {
        for (size_t j = 0; j < columnsCount; j++)
        {
            std::cout << numbers[i][j];

            if (j < (columnsCount - 1))
            {
                std::cout << " ";
            }
        }

        if (i < (rowsCount - 1))
        {
            std::cout << "\n";
        }
    }
}

void printArrayAsTransposedOne(double** numbers, size_t rowsCount, size_t columnsCount)
{
    for (size_t j = 0; j < columnsCount; j++)
    {
        for (size_t i = 0; i < rowsCount; i++)
        {
            std::cout << numbers[i][j];

            if (i < (rowsCount - 1))
            {
                std::cout << " ";
            }
        }

        if (j < (columnsCount - 1))
        {
            std::cout << "\n";
        }
    }
}

void disposeTheArray(double** array, size_t rowsCount)
{
    for (size_t i = 0; i < rowsCount; i++)
    {
        delete[] array[i];
    }

    delete[] array;
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {

        Scanner scanner = new Scanner(System.in);


        int hourExam = Integer.parseInt(scanner.nextLine());
        int minuteExam = Integer.parseInt(scanner.nextLine());
        int hourArrival = Integer.parseInt(scanner.nextLine());
        int minuteArrival = Integer.parseInt(scanner.nextLine());

        int examInMin = hourExam * 60 + minuteExam;
        int arrivalInMin = hourArrival * 60 + minuteArrival;

        if (arrivalInMin > examInMin) {
            if (arrivalInMin - examInMin < 60) {
                System.out.printf("Late%n%d minutes after the start", arrivalInMin - examInMin);
            } else {
                int hour = (arrivalInMin - examInMin) / 60;
                int minutes = (arrivalInMin - examInMin) % 60;
                System.out.printf("Late%n%d:%02d hours after the start", hour, minutes);
            }
        } else if (examInMin == arrivalInMin) {
            System.out.println("On time");
        } else if (examInMin - arrivalInMin <= 30) {
            System.out.printf("On time%n%d minutes before the start", examInMin - arrivalInMin);
        } else if (examInMin - arrivalInMin > 30 && examInMin - arrivalInMin < 60) {
            System.out.println("Early");
            System.out.printf("%d minutes before the start", examInMin - arrivalInMin);
        } else if (examInMin - arrivalInMin >= 60) {
            int hour = (examInMin - arrivalInMin) / 60;
            int minutes = (examInMin - arrivalInMin) % 60;
            System.out.printf("Early%n%d:%02d hours before the start", hour, minutes);
        }

    }

}

